import React from "react";

export default function About() {
    return (
        <>
            <h2 className="title-1">About</h2>
            <p>I am a frontend developer with a particular interest in making things simple and autmating daily tasks. I try to keep up with security and best practices, and am always looking for new things to learn.</p>
        </>
    )
}
